public class PaydayLendingApp extends Activity {

    private TextView mLoadingScreen;
    private EditText mAmount;
    private EditText mDuration;
    private EditText mInterestRate;
    private EditText mTotal;
    private EditText mTotalWithInterest;

    @Override
    public void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        mLoadingScreen = (TextView) findViewById(R.id.loading_screen);
        mAmount = (EditText) findViewById(R.id.amount);
        mDuration = (EditText) findViewById(R.id.duration);
        mInterestRate = (EditText) findViewById(R.id.interest_rate);
        mTotal = (EditText) findViewById(R.id.total);
        mTotalWithInterest = (EditText) findViewById(R.id.total_with_interest);

        mLoadingScreen.setVisibility(View.VISIBLE);

        new Thread() {
            public void run() {
                try {
                    Thread.sleep(5000);
                } catch (InterruptedException e) {
                    e.printStackTrace();
                }

                mLoadingScreen.setVisibility(View.GONE);

                double amount = Double.parseDouble(mAmount.getText().toString());
                double duration = Double.parseDouble(mDuration.getText().toString());
                double interestRate = Double.parseDouble(mInterestRate.getText().toString());

                double total = amount * duration;
                double totalWithInterest = total * (1 + interestRate / 100);

                mTotal.setText(String.valueOf(total));
                mTotalWithInterest.setText(String.valueOf(totalWithInterest));
            }
        }.start();
    }

    @Override
    public void onDestroy() {
        super.onDestroy();

        mLoadingScreen.setVisibility(View.VISIBLE);
