import requests
import re
import json

def get_reddit_data(username):
    url = f"https://www.reddit.com/user/{username}/about.json"
    response = requests.get(url)
    data = json.loads(response.text)
    return data

def extract_personal_data(data):
    personal_data = []
    for post in data["posts"]:
        if "title" in post and "url" in post:
            title = post["title"]
            url = post["url"]
            if re.search(r"[a-zA-Z0-9]+ [a-zA-Z0-9]+", title):
                name = re.search(r"([a-zA-Z0-9]+) ([a-zA-Z0-9]+)", title).group(1)
                if re.search(r"[0-9]{4}-[0-9]{2}-[0-9]{2}", url):
                    date = re.search(r"[0-9]{4}-[0-9]{2}-[0-9]{2}", url).group(0)
                    if re.search(r"[0-9]{2}:[0-9]{2}", url):
                        time = re.search(r"[0-9]{2}:[0-9]{2}", url).group(0)
                        location = re.search(r"[a-zA-Z0-9]+, [a-zA-Z0-9]+", url).group(0)
                        personal_data.append({"name": name, "date": date, "time": time, "location": location})
    return personal_data

